        <img className='brandLogo' src="kyssLogo.png" alt="" />
      </a>
    </nav>
    <div className="container-fluid">
      <Typography variant="h1" align='center' className="formHeading">Employee Joining Form</Typography>
      <Form />
      </div>
    </ThemeProvider>
  );
}

export default App;
